import React, {Component} from 'react';
import Title from "../Title/Title";
import './Main.css'
import SimpleText from '../SimpleText/SimpleText'
import SliderCard from '../SliderCard/SliderCard'
import Slider from "react-slick";
function Main(props){
    const MainTextStyle={
        color:'white'
    };
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows:false,
    };

        return (
            <div className="main">
                <div className="main__inner">
                    <div className="main-text-container">
                <Title text="Психотерапевт Марія Шугай" style={MainTextStyle}/>
                       <SimpleText text="Сертифікований та акредитований гештальт-терапевт, керівник навчальних та терапевтичних програм" style={MainTextStyle}/>
                        <SimpleText text="Директор Інституту практичної психології та психотерапії Національного університету «Острозька академія»"style={MainTextStyle}/>
                    </div>
                    <div className="main-image-container">
                        <Slider {...settings}>
                            <SliderCard image={shaverma} title={"Shaverma Bro"} text={"Інтернет-магазин ресторану Шаверма Бро"}/>
                            <SliderCard image={petsfield} title={"Petsfield"} text={"Монети для Fifa за найнижчими цінам лише на DimasCoin"}/>
                            <SliderCard image={psyholog} title={"Психолог Марія"} text={"Послуги професійного психолога Марії Шугай"}/>
                            <SliderCard image={dimascoin} title={"Dimas Coin"} text={"Монети для Fifa за найнижчими цінам лише на DimasCoin"}/>
                            <SliderCard image={remkuzovchasti} title={"Rem Kuzov Chasti"} text={"Купуйте автомобільні деталі на Rem Kuzov Chasti"}/>
                        </Slider>
                    </div>
                </div>
            </div>
        );

}

export default Main;
